import { cssTransition } from "react-toastify"

export default function Focused(props) {

  const renderFocusedList = () => {
    return props.focused.map((item, i) => (
      <div>
        <div
          style={{
            width: "calc(33vw - 19px)", 
            height: "25px",
            border: "1px solid black",
            backgroundColor: "#4382BC",
            color: "white",
            fontSize: "21px",
            textAlign: "center",
            paddingTop: "3px",
          }} 
          onClick={(e) => {
            console.log(e.nativeEvent.path)
            // if (e.target.style.height === "343px") {
            //   e.target.style.height = "27px"
            // }
          }}
          key={`F${i}`}
          >
            {item[0].resources[0].data.name}
        </div>
        <div style={{
          width: "calc(33vw - 20px)", 
          height: "0px",
          borderRadius: "0px 1px 1px 1px",
          borderStyle: "solid black",
          marginBottom: "5  px"
          }} 
        />
      </div>
    ))
  }

  return (
    <div style={{
      overflowY: "scroll",
      overflowX: "hidden",
      position: "absolute", 
      width: "33vw", 
      height: "85.5vh", 
      left: "65.5vw",
      top: "13vh"
    }}>{renderFocusedList()}</div>
  )
}
